goog.require("axs.AuditRules");goog.require("axs.constants.Severity");goog.require("axs.utils");axs.AuditRules.addRule({name:"unfocusableElementsWithOnClick",heading:"Elements with onclick handlers must be focusable",url:"https://github.com/GoogleChrome/accessibility-developer-tools/wiki/Audit-Rules#ax_focus_02",severity:axs.constants.Severity.WARNING,opt_requires:{consoleAPI:!0},relevantElementMatcher:function(element,flags){if(element instanceof element.ownerDocument.defaultView.HTMLBodyElement){return!1}if(flags.hidden){return!1}var eventListeners=getEventListeners(element);if("click"in eventListeners){return!0}return!1},test:function(element){return!element.hasAttribute("tabindex")&&!axs.utils.isElementImplicitlyFocusable(element)&&!element.disabled},code:"AX_FOCUS_02"});